        /// <summary>
        ///   Raise a exception to abort the process when called.
        /// </summary>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'Abort'.
        /// </param>
        /// <param name="error_msg">
        ///   Optional argument
        ///   A string which is the message associated with the exception.
        /// </param>
        /// <param name="exit_without_error">
        ///   Optional argument
        /// </param>
        /// <returns>
        ///   Returns the description of the operation
        /// </returns>
        /// <remarks>
        ///   If exit_without_error is true, the process will exit normally,
        ///   otherwise it will exit with a SIGABORT signal.
        ///   
        ///   Returns nothing but an exception.
        /// </remarks>
        public Operation Abort (string error_msg = null, bool? exit_without_error = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("Abort") OpName(MakeName("Abort", operName));
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (error_msg != null) {
                desc.SetAttr("error_msg", error_msg);
            }

            if (exit_without_error.HasValue) {
                desc.SetAttr("exit_without_error", exit_without_error);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("Abort") Message(status.Message);
                }
                return op;
            }
        }

        /// <summary>
