        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   Given a tensor <c>x</c>, this operation returns a tensor containing the absolute
        ///   value of each element in <c>x</c>. For example, if x is an input element and y is
        ///   an output element, this operation computes \\(y = |x|\\).
        /// </remarks>
        public Output Abs (Output! x, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("Abs") OpName(MakeName("Abs", operName));
            desc.AddInput(x);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("Abs") Message(status.Message);
                }
                int _idx = 0;
                var y = new Output withOp(op) Index(_idx++);
                return y;
            }
        }

        /// <summary>
        ///   Returns the element-wise sum of a list of tensors.
        /// </summary>
        /// <param name="inputs">
        ///   A list of <c>Tensor</c> objects, each with same shape and type.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'AccumulateNV2'.
        /// </param>
        /// <param name="shape">
        ///   Shape of elements of <c>inputs</c>.
        /// </param>
        /// <returns>
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   <c>tf.accumulate_n_v2</c> performs the same operation as <c>tf.add_n</c>, but does not
        ///   wait for all of its inputs to be ready before beginning to sum. This can
        ///   save memory if inputs are ready at different times, since minimum temporary
        ///   storage is proportional to the output size rather than the inputs size.
        ///   
        ///   Unlike the original <c>accumulate_n</c>, <c>accumulate_n_v2</c> is differentiable.
        ///   
        ///   Returns a <c>Tensor</c> of same shape and type as the elements of <c>inputs</c>.
        /// </remarks>
        public Output AccumulateNV2 (Output![] inputs, Shape shape, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("AccumulateNV2") OpName(MakeName("AccumulateNV2", operName));
            desc.AddInputs(inputs);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("shape", shape);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("AccumulateNV2") Message(status.Message);
                }
                int _idx = 0;
                var sum = new Output withOp(op) Index(_idx++);
                return sum;
            }
        }

