        /// <summary>
        ///   Extracts the average gradient in the given ConditionalAccumulator.
        /// </summary>
        /// <param name="handle">
        ///   The handle to an accumulator.
        /// </param>
        /// <param name="num_required">
        ///   Number of gradients required before we return an aggregate.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'AccumulatorTakeGradient'.
        /// </param>
        /// <param name="dtype">
        ///   The data type of accumulated gradients. Needs to correspond to the type
        ///   of the accumulator.
        /// </param>
        /// <returns>
        ///   The average of the accumulated gradients.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   The op blocks until sufficient (i.e., more than num_required)
        ///   gradients have been accumulated.  If the accumulator has already
        ///   aggregated more than num_required gradients, it returns the average of
        ///   the accumulated gradients.  Also automatically increments the recorded
        ///   global_step in the accumulator by 1, and resets the aggregate to 0.
        /// </remarks>
        public Output AccumulatorTakeGradient (Output! handle, Output! num_required, DataType dtype, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("AccumulatorTakeGradient") OpName(MakeName("AccumulatorTakeGradient", operName));
            desc.AddInput(handle);
            desc.AddInput(num_required);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("dtype", dtype);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("AccumulatorTakeGradient") Message(status.Message);
                }
                int _idx = 0;
                var average = new Output withOp(op) Index(_idx++);
                return average;
            }
        }

