            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (container != null) {
                desc.SetAttr("container", container);
            }

            if (shared_name != null) {
                desc.SetAttr("shared_name", shared_name);
            }

            using (var status = new Status()) {
