        /// <summary>
        ///   Compute the regularized incomplete beta integral \\(I_x(a, b)\\).
        /// </summary>
        /// <param name="a">
        /// </param>
        /// <param name="b">
        /// </param>
        /// <param name="x">
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'Betainc'.
        /// </param>
        /// <returns>
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   The regularized incomplete beta integral is defined as:
        ///   
        ///   
        ///   \\(I_x(a, b) = \frac{B(x; a, b)}{B(a, b)}\\)
        ///   
        ///   where
        ///   
        ///   
        ///   \\(B(x; a, b) = \int_0^x t^{a-1} (1 - t)^{b-1} dt\\)
        ///   
        ///   
        ///   is the incomplete beta function and \\(B(a, b)\\) is the *complete*
        ///   beta function.
        /// </remarks>
        public Output Betainc (Output! a, Output! b, Output! x, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("Betainc") OpName(MakeName("Betainc", operName));
            desc.AddInput(a);
            desc.AddInput(b);
            desc.AddInput(x);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("Betainc") Message(status.Message);
                }
                int _idx = 0;
                var z = new Output withOp(op) Index(_idx++);
                return z;
            }
        }

