        /// <summary>
        ///   Greedily selects a subset of bounding boxes in descending order of score,
        /// </summary>
        /// <param name="boxes">
        ///   A 4-D float tensor of shape <c>[batch_size, num_boxes, q, 4]</c>. If <c>q</c> is 1 then
        ///   same boxes are used for all classes otherwise, if <c>q</c> is equal to number of
        ///   classes, class-specific boxes are used.
        /// </param>
        /// <param name="scores">
        ///   A 3-D float tensor of shape <c>[batch_size, num_boxes, num_classes]</c>
        ///   representing a single score corresponding to each box (each row of boxes).
        /// </param>
        /// <param name="max_output_size_per_class">
        ///   A scalar integer tensor representing the maximum number of
        ///   boxes to be selected by non max suppression per class
        /// </param>
        /// <param name="max_total_size">
        ///   A scalar representing maximum number of boxes retained over all classes.
        /// </param>
        /// <param name="iou_threshold">
        ///   A 0-D float tensor representing the threshold for deciding whether
        ///   boxes overlap too much with respect to IOU.
        /// </param>
        /// <param name="score_threshold">
        ///   A 0-D float tensor representing the threshold for deciding when to remove
        ///   boxes based on score.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'CombinedNonMaxSuppression'.
        /// </param>
        /// <param name="pad_per_class">
        ///   Optional argument
        ///   If false, the output nmsed boxes, scores and classes
        ///   are padded/clipped to <c>max_total_size</c>. If true, the
        ///   output nmsed boxes, scores and classes are padded to be of length
        ///   <c>max_size_per_class</c>*<c>num_classes</c>, unless it exceeds <c>max_total_size</c> in
        ///   which case it is clipped to <c>max_total_size</c>. Defaults to false.
        /// </param>
        /// <param name="clip_boxes">
        ///   Optional argument
        ///   If true, assume the box coordinates are between [0, 1] and clip the output boxes
        ///   if they fall beyond [0, 1]. If false, do not do clipping and output the box
        ///   coordinates as it is.
        /// </param>
        /// <returns>
        ///   Returns a tuple with multiple values, as follows:
        ///   nmsed_boxes: A [batch_size, max_detections, 4] float32 tensor
        ///   containing the non-max suppressed boxes.
        ///   nmsed_scores: A [batch_size, max_detections] float32 tensor
        ///   containing the scores for the boxes.
        ///   nmsed_classes: A [batch_size, max_detections] float32 tensor
        ///   containing the classes for the boxes.
        ///   valid_detections: A [batch_size] int32 tensor indicating the number of
        ///   valid detections per batch item. Only the top num_detections[i] entries in
        ///   nms_boxes[i], nms_scores[i] and nms_class[i] are valid. The rest of the
        ///   entries are zero paddings.
        ///   The Operation can be fetched from any of the Outputs returned in the tuple values, by fetching the Operation property.
        /// </returns>
        /// <remarks>
        ///   This operation performs non_max_suppression on the inputs per batch, across
        ///   all classes.
        ///   Prunes away boxes that have high intersection-over-union (IOU) overlap
        ///   with previously selected boxes.  Bounding boxes are supplied as
        ///   [y1, x1, y2, x2], where (y1, x1) and (y2, x2) are the coordinates of any
        ///   diagonal pair of box corners and the coordinates can be provided as normalized
        ///   (i.e., lying in the interval [0, 1]) or absolute.  Note that this algorithm
        ///   is agnostic to where the origin is in the coordinate system. Also note that
        ///   this algorithm is invariant to orthogonal transformations and translations
        ///   of the coordinate system; thus translating or reflections of the coordinate
        ///   system result in the same boxes being selected by the algorithm.
        ///   The output of this operation is the final boxes, scores and classes tensor
        ///   returned after performing non_max_suppression.
        /// </remarks>
        public (Output nmsed_boxes, Output nmsed_scores, Output nmsed_classes, Output valid_detections) CombinedNonMaxSuppression (Output! boxes, Output! scores, Output! max_output_size_per_class, Output! max_total_size, Output! iou_threshold, Output! score_threshold, bool? pad_per_class = null, bool? clip_boxes = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("CombinedNonMaxSuppression") OpName(MakeName("CombinedNonMaxSuppression", operName));
            desc.AddInput(boxes);
            desc.AddInput(scores);
            desc.AddInput(max_output_size_per_class);
            desc.AddInput(max_total_size);
            desc.AddInput(iou_threshold);
            desc.AddInput(score_threshold);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (pad_per_class.HasValue) {
                desc.SetAttr("pad_per_class", pad_per_class);
            }

            if (clip_boxes.HasValue) {
                desc.SetAttr("clip_boxes", clip_boxes);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("CombinedNonMaxSuppression") Message(status.Message);
                }
                int _idx = 0;
                var nmsed_boxes = new Output withOp(op) Index(_idx++);
                var nmsed_scores = new Output withOp(op) Index(_idx++);
                var nmsed_classes = new Output withOp(op) Index(_idx++);
                var valid_detections = new Output withOp(op) Index(_idx++);
                return (nmsed_boxes, nmsed_scores, nmsed_classes, valid_detections);
            }
        }

        /// <summary>
        ///   Compare values of <c>input</c> to <c>threshold</c> and pack resulting bits into a <c>uint8</c>.
        /// </summary>
        /// <param name="input">
        ///   Values to compare against <c>threshold</c> and bitpack.
        /// </param>
        /// <param name="threshold">
        ///   Threshold to compare against.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'CompareAndBitpack'.
        /// </param>
        /// <returns>
        ///   The bitpacked comparisons.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   Each comparison returns a boolean <c>true</c> (if <c>input_value &amp;gt; threshold</c>)
        ///   or and <c>false</c> otherwise.
        ///   
        ///   This operation is useful for Locality-Sensitive-Hashing (LSH) and other
        ///   algorithms that use hashing approximations of cosine and <c>L2</c> distances;
        ///   codes can be generated from an input via:
        ///   
        ///    <code>
        ///   codebook_size = 50
        ///   codebook_bits = codebook_size * 32
        ///   codebook = tf.get_variable('codebook', [x.shape[-1].value, codebook_bits],
        ///   dtype=x.dtype,
        ///   initializer=tf.orthogonal_initializer())
        ///   codes = compare_and_threshold(tf.matmul(x, codebook), threshold=0.)
        ///   codes = tf.bitcast(codes, tf.int32)  # go from uint8 to int32
        ///   # now codes has shape x.shape[:-1] + [codebook_size]
        ///    </code>
        ///   
        ///   **NOTE**: Currently, the innermost dimension of the tensor must be divisible
        ///   by 8.
        ///   
        ///   Given an <c>input</c> shaped <c>[s0, s1, ..., s_n]</c>, the output is
        ///   a <c>uint8</c> tensor shaped <c>[s0, s1, ..., s_n / 8]</c>.
        /// </remarks>
        public Output CompareAndBitpack (Output! input, Output! threshold, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("CompareAndBitpack") OpName(MakeName("CompareAndBitpack", operName));
            desc.AddInput(input);
            desc.AddInput(threshold);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("CompareAndBitpack") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

