        ///   Otherwise, a default container is used.
        /// </param>
        /// <param name="shared_name">
        ///   Optional argument
        ///   If non-empty, this accumulator will be shared under the
        ///   given name across multiple sessions.
        /// </param>
        /// <param name="reduction_type">
        ///   Optional argument
        /// </param>
        /// <param name="dtype">
        ///   The type of the value being accumulated.
        /// </param>
        /// <param name="shape">
        ///   The shape of the values, can be [], in which case shape is unknown.
        /// </param>
        /// <returns>
        ///   The handle to the accumulator.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   The accumulator accepts gradients marked with local_step greater or
        ///   equal to the most recent global_step known to the accumulator. The
        ///   average can be extracted from the accumulator, provided sufficient
        ///   gradients have been accumulated. Extracting the average automatically
        ///   resets the aggregate to 0, and increments the global_step recorded by
        ///   the accumulator.
        /// </remarks>
        public Output ConditionalAccumulator (DataType dtype, Shape shape, string container = null, string shared_name = null, string reduction_type = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("ConditionalAccumulator") OpName(MakeName("ConditionalAccumulator", operName));
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("dtype", dtype);
