                    throw new OpCreateException withOpType("CTCGreedyDecoder") Message(status.Message);
                }
                int _idx = 0;
                var decoded_indices = new Output withOp(op) Index(_idx++);
                var decoded_values = new Output withOp(op) Index(_idx++);
                var decoded_shape = new Output withOp(op) Index(_idx++);
                var log_probability = new Output withOp(op) Index(_idx++);
