            desc.AddInput(filter);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("strides", strides);
            desc.SetAttr("rates", rates);
            desc.SetAttr("padding", padding);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("Dilation2D") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

