        ///   shape(expand_dims(t, 1)) ==&amp;gt; [2, 1]
        ///   shape(expand_dims(t, -1)) ==&amp;gt; [2, 1]
        ///   
        ///   # 't2' is a tensor of shape [2, 3, 5]
