        /// <summary>
        ///   Generates labels for candidate sampling with a learned unigram distribution.
        /// </summary>
        /// <param name="true_classes">
        ///   A batch_size * num_true matrix, in which each row contains the
        ///   IDs of the num_true target_classes in the corresponding original label.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'FixedUnigramCandidateSampler'.
        /// </param>
        /// <param name="vocab_file">
        ///   Optional argument
        ///   Each valid line in this file (which should have a CSV-like format)
        ///   corresponds to a valid word ID. IDs are in sequential order, starting from
        ///   num_reserved_ids. The last entry in each line is expected to be a value
        ///   corresponding to the count or relative probability. Exactly one of vocab_file
        ///   and unigrams needs to be passed to this op.
        /// </param>
        /// <param name="distortion">
        ///   Optional argument
        ///   The distortion is used to skew the unigram probability distribution.
        ///   Each weight is first raised to the distortion's power before adding to the
        ///   internal unigram distribution. As a result, distortion = 1.0 gives regular
        ///   unigram sampling (as defined by the vocab file), and distortion = 0.0 gives
        ///   a uniform distribution.
        /// </param>
        /// <param name="num_reserved_ids">
        ///   Optional argument
        ///   Optionally some reserved IDs can be added in the range [0,
        ///   ..., num_reserved_ids) by the users. One use case is that a special unknown
        ///   word token is used as ID 0. These IDs will have a sampling probability of 0.
        /// </param>
        /// <param name="num_shards">
        ///   Optional argument
        ///   A sampler can be used to sample from a subset of the original range
        ///   in order to speed up the whole computation through parallelism. This parameter
        ///   (together with 'shard') indicates the number of partitions that are being
        ///   used in the overall computation.
        /// </param>
        /// <param name="shard">
        ///   Optional argument
        ///   A sampler can be used to sample from a subset of the original range
        ///   in order to speed up the whole computation through parallelism. This parameter
        ///   (together with 'num_shards') indicates the particular partition number of a
        ///   sampler op, when partitioning is being used.
        /// </param>
        /// <param name="unigrams">
        ///   Optional argument
        ///   A list of unigram counts or probabilities, one per ID in sequential
        ///   order. Exactly one of vocab_file and unigrams should be passed to this op.
        /// </param>
        /// <param name="seed">
        ///   Optional argument
        ///   If either seed or seed2 are set to be non-zero, the random number
        ///   generator is seeded by the given seed.  Otherwise, it is seeded by a
        ///   random seed.
        /// </param>
        /// <param name="seed2">
        ///   Optional argument
        ///   An second seed to avoid seed collision.
        /// </param>
        /// <param name="num_true">
        ///   Number of true labels per context.
        /// </param>
        /// <param name="num_sampled">
        ///   Number of candidates to randomly sample.
        /// </param>
        /// <param name="unique">
        ///   If unique is true, we sample with rejection, so that all sampled
        ///   candidates in a batch are unique. This requires some approximation to
        ///   estimate the post-rejection sampling probabilities.
        /// </param>
        /// <param name="range_max">
        ///   The sampler will sample integers from the interval [0, range_max).
        /// </param>
        /// <returns>
        ///   Returns a tuple with multiple values, as follows:
        ///   sampled_candidates: A vector of length num_sampled, in which each element is
        ///   the ID of a sampled candidate.
        ///   true_expected_count: A batch_size * num_true matrix, representing
        ///   the number of times each candidate is expected to occur in a batch
        ///   of sampled candidates. If unique=true, then this is a probability.
        ///   sampled_expected_count: A vector of length num_sampled, for each sampled
        ///   candidate representing the number of times the candidate is expected
        ///   to occur in a batch of sampled candidates.  If unique=true, then this is a
        ///   probability.
        ///   The Operation can be fetched from any of the Outputs returned in the tuple values, by fetching the Operation property.
        /// </returns>
        /// <remarks>
        ///   A unigram sampler could use a fixed unigram distribution read from a
        ///   file or passed in as an in-memory array instead of building up the distribution
        ///   from data on the fly. There is also an option to skew the distribution by
        ///   applying a distortion power to the weights.
        ///   
        ///   The vocabulary file should be in CSV-like format, with the last field
        ///   being the weight associated with the word.
        ///   
        ///   For each batch, this op picks a single set of sampled candidate labels.
        ///   
        ///   The advantages of sampling candidates per-batch are simplicity and the
        ///   possibility of efficient dense matrix multiplication. The disadvantage is that
        ///   the sampled candidates must be chosen independently of the context and of the
        ///   true labels.
        /// </remarks>
        public (Output sampled_candidates, Output true_expected_count, Output sampled_expected_count) FixedUnigramCandidateSampler (Output! true_classes, long num_true, long num_sampled, bool unique, long range_max, string vocab_file = null, float? distortion = null, long? num_reserved_ids = null, long? num_shards = null, long? shard = null, float[] unigrams = null, long? seed = null, long? seed2 = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("FixedUnigramCandidateSampler") OpName(MakeName("FixedUnigramCandidateSampler", operName));
            desc.AddInput(true_classes);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("num_true", num_true);
            desc.SetAttr("num_sampled", num_sampled);
            desc.SetAttr("unique", unique);
            desc.SetAttr("range_max", range_max);
            
            if (vocab_file != null) {
                desc.SetAttr("vocab_file", vocab_file);
            }

            if (distortion.HasValue) {
                desc.SetAttr("distortion", distortion);
            }

            if (num_reserved_ids.HasValue) {
                desc.SetAttr("num_reserved_ids", num_reserved_ids);
            }

            if (num_shards.HasValue) {
                desc.SetAttr("num_shards", num_shards);
            }

            if (shard.HasValue) {
                desc.SetAttr("shard", shard);
            }

            if (unigrams != null) {
                desc.SetAttr("unigrams", unigrams);
            }

            if (seed.HasValue) {
                desc.SetAttr("seed", seed);
            }

            if (seed2.HasValue) {
                desc.SetAttr("seed2", seed2);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("FixedUnigramCandidateSampler") Message(status.Message);
                }
                int _idx = 0;
