            desc.AddInput(h_prev);
            desc.AddInput(w_ru);
            desc.AddInput(w_c);
            desc.AddInput(b_ru);
            desc.AddInput(b_c);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("GRUBlockCell") Message(status.Message);
                }
                int _idx = 0;
                var r = new Output withOp(op) Index(_idx++);
                var u = new Output withOp(op) Index(_idx++);
                var c = new Output withOp(op) Index(_idx++);
                var h = new Output withOp(op) Index(_idx++);
                return (r, u, c, h);
