        /// <param name="h_prev">
        /// </param>
        /// <param name="w_ru">
        /// </param>
        /// <param name="w_c">
        /// </param>
        /// <param name="b_ru">
        /// </param>
        /// <param name="b_c">
        /// </param>
        /// <param name="r">
        /// </param>
        /// <param name="u">
