        ///    <code>
        ///   b_ru = [b_ru_x b_ru_h]
        ///   b_c = [b_c_x b_c_h]
        ///    </code>
        ///   Another note on notation:
        ///    <code>
        ///   d_x = d_x_component_1 + d_x_component_2
        ///   
        ///   where d_x_component_1 = d_r_bar * w_r_x^T + d_u_bar * w_r_x^T
        ///   and d_x_component_2 = d_c_bar * w_c_x^T
        ///   
        ///   d_h_prev = d_h_prev_component_1 + d_h_prevr \circ r + d_h \circ u
        ///   where d_h_prev_componenet_1 = d_r_bar * w_r_h_prev^T + d_u_bar * w_r_h_prev^T
        ///    </code>
        ///   
        ///   Mathematics behind the Gradients below:
        ///    <code>
        ///   d_c_bar = d_h \circ (1-u) \circ (1-c \circ c)
        ///   d_u_bar = d_h \circ (h-c) \circ u \circ (1-u)
        ///   
        ///   d_r_bar_u_bar = [d_r_bar d_u_bar]
        ///   
        ///   [d_x_component_1 d_h_prev_component_1] = d_r_bar_u_bar * w_ru^T
        ///   
        ///   [d_x_component_2 d_h_prevr] = d_c_bar * w_c^T
        ///   
        ///   d_x = d_x_component_1 + d_x_component_2
        ///   
        ///   d_h_prev = d_h_prev_component_1 + d_h_prevr \circ r + u
        ///    </code>
        ///   Below calculation is performed in the python wrapper for the Gradients
        ///   (not in the gradient kernel.)
        ///    <code>
        ///   d_w_ru = x_h_prevr^T * d_c_bar
        ///   
        ///   d_w_c = x_h_prev^T * d_r_bar_u_bar
        ///   
        ///   d_b_ru = sum of d_r_bar_u_bar along axis = 0
        ///   
        ///   d_b_c = sum of d_c_bar along axis = 0
        ///    </code>
        /// </remarks>
        public (Output d_x, Output d_h_prev, Output d_c_bar, Output d_r_bar_u_bar) GRUBlockCellGrad (Output! x, Output! h_prev, Output! w_ru, Output! w_c, Output! b_ru, Output! b_c, Output! r, Output! u, Output! c, Output! d_h, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("GRUBlockCellGrad") OpName(MakeName("GRUBlockCellGrad", operName));
            desc.AddInput(x);
            desc.AddInput(h_prev);
            desc.AddInput(w_ru);
            desc.AddInput(w_c);
            desc.AddInput(b_ru);
            desc.AddInput(b_c);
            desc.AddInput(r);
            desc.AddInput(u);
            desc.AddInput(c);
            desc.AddInput(d_h);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("GRUBlockCellGrad") Message(status.Message);
                }
                int _idx = 0;
                var d_x = new Output withOp(op) Index(_idx++);
                var d_h_prev = new Output withOp(op) Index(_idx++);
                var d_c_bar = new Output withOp(op) Index(_idx++);
                var d_r_bar_u_bar = new Output withOp(op) Index(_idx++);
