            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("ImageSummary") Message(status.Message);
                }
                int _idx = 0;
                var summary = new Output withOp(op) Index(_idx++);
                return summary;
            }
        }

