        /// <summary>
        ///   Local Response Normalization.
        /// </summary>
        /// <param name="input">
        ///   4-D.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'LRN'.
        /// </param>
        /// <param name="depth_radius">
        ///   Optional argument
        ///   0-D.  Half-width of the 1-D normalization window.
        /// </param>
        /// <param name="bias">
        ///   Optional argument
        ///   An offset (usually positive to avoid dividing by 0).
        /// </param>
        /// <param name="alpha">
        ///   Optional argument
        ///   A scale factor, usually positive.
        /// </param>
        /// <param name="beta">
        ///   Optional argument
        ///   An exponent.
        /// </param>
        /// <returns>
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   The 4-D <c>input</c> tensor is treated as a 3-D array of 1-D vectors (along the last
        ///   dimension), and each vector is normalized independently.  Within a given vector,
        ///   each component is divided by the weighted, squared sum of inputs within
        ///   <c>depth_radius</c>.  In detail,
        ///   
        ///   sqr_sum[a, b, c, d] =
        ///   sum(input[a, b, c, d - depth_radius : d + depth_radius + 1] ** 2)
        ///   output = input / (bias + alpha * sqr_sum) ** beta
        ///   
        ///   For details, see [Krizhevsky et al., ImageNet classification with deep
        ///   convolutional neural networks (NIPS 2012)](http://papers.nips.cc/paper/4824-imagenet-classification-with-deep-convolutional-neural-networks).
        /// </remarks>
        public Output LRN (Output! input, long? depth_radius = null, float? bias = null, float? alpha = null, float? beta = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("LRN") OpName(MakeName("LRN", operName));
            desc.AddInput(input);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (depth_radius.HasValue) {
                desc.SetAttr("depth_radius", depth_radius);
            }

            if (bias.HasValue) {
                desc.SetAttr("bias", bias);
            }

            if (alpha.HasValue) {
                desc.SetAttr("alpha", alpha);
            }

            if (beta.HasValue) {
                desc.SetAttr("beta", beta);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("LRN") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

