        /// <summary>
        ///   Computes the LSTM cell forward propagation for 1 time step.
        /// </summary>
        /// <param name="x">
        ///   The input to the LSTM cell, shape (batch_size, num_inputs).
        /// </param>
        /// <param name="cs_prev">
        ///   Value of the cell state at previous time step.
        /// </param>
        /// <param name="h_prev">
        ///   Output of the previous cell at previous time step.
        /// </param>
        /// <param name="w">
        ///   The weight matrix.
        /// </param>
        /// <param name="wci">
        ///   The weight matrix for input gate peephole connection.
        /// </param>
        /// <param name="wcf">
        ///   The weight matrix for forget gate peephole connection.
        /// </param>
        /// <param name="wco">
        ///   The weight matrix for output gate peephole connection.
        /// </param>
        /// <param name="b">
        ///   The bias vector.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'LSTMBlockCell'.
        /// </param>
        /// <param name="forget_bias">
        ///   Optional argument
        ///   The forget gate bias.
        /// </param>
        /// <param name="cell_clip">
        ///   Optional argument
        ///   Value to clip the 'cs' value to.
        /// </param>
        /// <param name="use_peephole">
        ///   Optional argument
        ///   Whether to use peephole weights.
        /// </param>
        /// <returns>
        ///   Returns a tuple with multiple values, as follows:
        ///   i: The input gate.
        ///   cs: The cell state before the tanh.
        ///   f: The forget gate.
        ///   o: The output gate.
        ///   ci: The cell input.
        ///   co: The cell after the tanh.
        ///   h: The output h vector.
        ///   The Operation can be fetched from any of the Outputs returned in the tuple values, by fetching the Operation property.
        /// </returns>
        /// <remarks>
        ///   This implementation uses 1 weight matrix and 1 bias vector, and there's an
        ///   optional peephole connection.
        ///   
        ///   This kernel op implements the following mathematical equations:
        ///   
        ///    <code>
        ///   xh = [x, h_prev]
        ///   [i, f, ci, o] = xh * w + b
        ///   f = f + forget_bias
        ///   
        ///   if not use_peephole:
        ///   wci = wcf = wco = 0
        ///   
        ///   i = sigmoid(cs_prev * wci + i)
        ///   f = sigmoid(cs_prev * wcf + f)
        ///   ci = tanh(ci)
        ///   
        ///   cs = ci .* i + cs_prev .* f
        ///   cs = clip(cs, cell_clip)
        ///   
        ///   o = sigmoid(cs * wco + o)
        ///   co = tanh(cs)
        ///   h = co .* o
        ///    </code>
        /// </remarks>
        public (Output i, Output cs, Output f, Output o, Output ci, Output co, Output h) LSTMBlockCell (Output! x, Output! cs_prev, Output! h_prev, Output! w, Output! wci, Output! wcf, Output! wco, Output! b, float? forget_bias = null, float? cell_clip = null, bool? use_peephole = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("LSTMBlockCell") OpName(MakeName("LSTMBlockCell", operName));
            desc.AddInput(x);
            desc.AddInput(cs_prev);
            desc.AddInput(h_prev);
            desc.AddInput(w);
            desc.AddInput(wci);
            desc.AddInput(wcf);
            desc.AddInput(wco);
            desc.AddInput(b);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (forget_bias.HasValue) {
                desc.SetAttr("forget_bias", forget_bias);
            }

            if (cell_clip.HasValue) {
                desc.SetAttr("cell_clip", cell_clip);
            }

            if (use_peephole.HasValue) {
                desc.SetAttr("use_peephole", use_peephole);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("LSTMBlockCell") Message(status.Message);
                }
                int _idx = 0;
                var i = new Output withOp(op) Index(_idx++);
                var cs = new Output withOp(op) Index(_idx++);
                var f = new Output withOp(op) Index(_idx++);
                var o = new Output withOp(op) Index(_idx++);
                var ci = new Output withOp(op) Index(_idx++);
                var co = new Output withOp(op) Index(_idx++);
                var h = new Output withOp(op) Index(_idx++);
                return (i, cs, f, o, ci, co, h);
            }
        }

