        /// <summary>
        ///   Locks a mutex resource.  The output is the lock.  So long as the lock tensor
        /// </summary>
        /// <param name="mutex">
        ///   The mutex resource to lock.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'MutexLock'.
        /// </param>
        /// <returns>
        ///   A tensor that keeps a shared pointer to a lock on the mutex;
        ///   when the Tensor is destroyed, the use count on the shared pointer is decreased
        ///   by 1.  When it reaches 0, the lock is released.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   is alive, any other request to use <c>MutexLock</c> with this mutex will wait.
        ///   
        ///   This is particularly useful for creating a critical section when used in
        ///   conjunction with <c>MutexLockIdentity</c>:
        ///   
        ///    <code>
        ///   
        ///   mutex = mutex_v2(
        ///   shared_name=handle_name, container=container, name=name)
        ///   
        ///   def execute_in_critical_section(fn, *args, **kwargs):
        ///   lock = gen_resource_variable_ops.mutex_lock(mutex)
        ///   
        ///   with ops.control_dependencies([lock]):
        ///   r = fn(*args, **kwargs)
        ///   
        ///   with ops.control_dependencies(nest.flatten(r)):
        ///   with ops.colocate_with(mutex):
        ///   ensure_lock_exists = mutex_lock_identity(lock)
        ///   
        ///   # Make sure that if any element of r is accessed, all of
        ///   # them are executed together.
        ///   r = nest.map_structure(tf.identity, r)
        ///   
        ///   with ops.control_dependencies([ensure_lock_exists]):
        ///   return nest.map_structure(tf.identity, r)
        ///    </code>
        ///   
        ///   While <c>fn</c> is running in the critical section, no other functions which wish to
        ///   use this critical section may run.
        ///   
        ///   Often the use case is that two executions of the same graph, in parallel,
        ///   wish to run <c>fn</c>; and we wish to ensure that only one of them executes
        ///   at a time.  This is especially important if <c>fn</c> modifies one or more
        ///   variables at a time.
        ///   
        ///   It is also useful if two separate functions must share a resource, but we
        ///   wish to ensure the usage is exclusive.
        /// </remarks>
        public Output MutexLock (Output! mutex, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("MutexLock") OpName(MakeName("MutexLock", operName));
            desc.AddInput(mutex);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("MutexLock") Message(status.Message);
                }
                int _idx = 0;
                var mutex_lock = new Output withOp(op) Index(_idx++);
                return mutex_lock;
            }
        }

