        /// <summary>
        ///   Returns a one-hot tensor.
        /// </summary>
        /// <param name="indices">
        ///   A tensor of indices.
        /// </param>
        /// <param name="depth">
        ///   A scalar defining the depth of the one hot dimension.
        /// </param>
        /// <param name="on_value">
        ///   A scalar defining the value to fill in output when <c>indices[j] = i</c>.
        /// </param>
        /// <param name="off_value">
        ///   A scalar defining the value to fill in output when <c>indices[j] != i</c>.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'OneHot'.
        /// </param>
        /// <param name="axis">
        ///   Optional argument
        ///   The axis to fill (default: -1, a new inner-most axis).
        /// </param>
        /// <returns>
        ///   The one-hot tensor.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   The locations represented by indices in <c>indices</c> take value <c>on_value</c>,
        ///   while all other locations take value <c>off_value</c>.
        ///   
        ///   If the input <c>indices</c> is rank <c>N</c>, the output will have rank <c>N+1</c>,
        ///   The new axis is created at dimension <c>axis</c> (default: the new axis is
        ///   appended at the end).
        ///   
        ///   If <c>indices</c> is a scalar the output shape will be a vector of length <c>depth</c>.
        ///   
        ///   If <c>indices</c> is a vector of length <c>features</c>, the output shape will be:
        ///    <code>
        ///   features x depth if axis == -1
        ///   depth x features if axis == 0
        ///    </code>
        ///   
        ///   If <c>indices</c> is a matrix (batch) with shape <c>[batch, features]</c>,
        ///   the output shape will be:
        ///    <code>
        ///   batch x features x depth if axis == -1
        ///   batch x depth x features if axis == 1
        ///   depth x batch x features if axis == 0
        ///    </code>
        ///   
        ///   
        ///   Examples
        ///   =========
        ///   
        ///   Suppose that
        ///    <code>
        ///   indices = [0, 2, -1, 1]
        ///   depth = 3
        ///   on_value = 5.0
        ///   off_value = 0.0
        ///   axis = -1
        ///    </code>
        ///   
        ///   Then output is <c>[4 x 3]</c>:
        ///    <code>
        ///   output =
        ///   [5.0 0.0 0.0]  // one_hot(0)
        ///   [0.0 0.0 5.0]  // one_hot(2)
        ///   [0.0 0.0 0.0]  // one_hot(-1)
        ///   [0.0 5.0 0.0]  // one_hot(1)
        ///    </code>
        ///   
        ///   Suppose that
        ///    <code>
        ///   indices = [0, 2, -1, 1]
        ///   depth = 3
        ///   on_value = 0.0
        ///   off_value = 3.0
        ///   axis = 0
        ///    </code>
        ///   
        ///   Then output is <c>[3 x 4]</c>:
        ///    <code>
        ///   output =
        ///   [0.0 3.0 3.0 3.0]
        ///   [3.0 3.0 3.0 0.0]
        ///   [3.0 3.0 3.0 3.0]
        ///   [3.0 0.0 3.0 3.0]
        ///   //  ^                one_hot(0)
        ///   //      ^            one_hot(2)
        ///   //          ^        one_hot(-1)
        ///   //              ^    one_hot(1)
        ///    </code>
        ///   
        ///   Suppose that
        ///    <code>
        ///   indices = [[0, 2], [1, -1]]
        ///   depth = 3
        ///   on_value = 1.0
        ///   off_value = 0.0
        ///   axis = -1
        ///    </code>
        ///   
        ///   Then output is <c>[2 x 2 x 3]</c>:
        ///    <code>
        ///   output =
        ///   [
        ///   [1.0, 0.0, 0.0]  // one_hot(0)
        ///   [0.0, 0.0, 1.0]  // one_hot(2)
        ///   ][
        ///   [0.0, 1.0, 0.0]  // one_hot(1)
        ///   [0.0, 0.0, 0.0]  // one_hot(-1)
        ///   ]
        ///    </code>
        /// </remarks>
        public Output OneHot (Output! indices, Output! depth, Output! on_value, Output! off_value, long? axis = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("OneHot") OpName(MakeName("OneHot", operName));
            desc.AddInput(indices);
            desc.AddInput(depth);
            desc.AddInput(on_value);
            desc.AddInput(off_value);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (axis.HasValue) {
                desc.SetAttr("axis", axis);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("OneHot") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

