            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("ParallelDynamicStitch") Message(status.Message);
                }
                int _idx = 0;
                var merged = new Output withOp(op) Index(_idx++);
                return merged;
            }
        }

