                int _idx = 0;
                int _n = 0;
                _n = op.GetOutputListLength("sparse_indices");
                var sparse_indices = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    sparse_indices [i] = new Output withOp(op) Index(_idx++);
                }

                _n = op.GetOutputListLength("sparse_values");
                var sparse_values = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    sparse_values [i] = new Output withOp(op) Index(_idx++);
                }

                _n = op.GetOutputListLength("sparse_shapes");
                var sparse_shapes = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    sparse_shapes [i] = new Output withOp(op) Index(_idx++);
