        /// <summary>
        ///   Quantizes then dequantizes a tensor.
        /// </summary>
        /// <param name="input">
        ///   Tensor to quantize and then dequantize.
        /// </param>
        /// <param name="input_min">
        ///   If <c>range_given == True</c>, this specifies the minimum input value that needs to
        ///   be represented, otherwise it is determined from the min value of the <c>input</c>
        ///   tensor.
        /// </param>
        /// <param name="input_max">
        ///   If <c>range_given == True</c>, this specifies the maximum input value that needs to
        ///   be represented, otherwise it is determined from the max value of the <c>input</c>
        ///   tensor.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'QuantizeAndDequantizeV2'.
        /// </param>
        /// <param name="signed_input">
        ///   Optional argument
        ///   Whether the quantization is signed or unsigned. (actually this parameter should
        ///   have been called &amp;lt;b&amp;gt;<c>signed_output</c>&amp;lt;/b&amp;gt;)
        /// </param>
        /// <param name="num_bits">
        ///   Optional argument
        ///   The bitwidth of the quantization.
        /// </param>
        /// <param name="range_given">
        ///   Optional argument
        ///   Whether the range is given or should be determined from the <c>input</c> tensor.
        /// </param>
        /// <param name="round_mode">
        ///   Optional argument
        ///   The 'round_mode' attribute controls which rounding tie-breaking algorithm is
        ///   used when rounding float values to their quantized equivalents. The following
        ///   rounding modes are currently supported:
        ///   
        ///   *   HALF_TO_EVEN: this is the default round_mode.
        ///   *   HALF_UP: round towards positive. In this mode 7.5 rounds up to 8 and -7.5
        ///   rounds up to -7.
        ///   
        /// </param>
        /// <param name="narrow_range">
        ///   Optional argument
        ///   If True, then the absolute value of the quantized minimum value is the same as
        ///   the quantized maximum value, instead of 1 greater.
        ///   i.e. for 8 bit quantization, the minimum value is -127 instead of -128.
        /// </param>
        /// <returns>
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   This op simulates the precision loss from the quantized forward pass by:
        ///   
        ///   1. Quantizing the tensor to fixed point numbers, which should match the target
        ///   quantization method when it is used in inference.
        ///   2. Dequantizing it back to floating point numbers for the following ops, most
        ///   likely matmul.
        ///   
        ///   There are different ways to quantize. This version uses only scaling, so 0.0
        ///   maps to 0.
        ///   
        ///   From the specified 'num_bits' in the quantized output type, it determines
        ///   minimum and maximum representable quantized values.
        ///   
        ///   e.g.
        ///   
        ///   *   [-128, 127] for signed, num_bits = 8, or
        ///   *   [0, 255] for unsigned, num_bits = 8.
        ///   
        ///   If range_given == False, the initial input_min, input_max will be determined
        ///   automatically as the minimum and maximum values in the input tensor, otherwise
        ///   the specified values of input_min, input_max are used.
        ///   
        ///   Note: If the input_min, input_max are specified, they do not need to equal the
        ///   actual minimum and maximum values in the tensor. e.g. in some cases it may be
        ///   beneficial to specify these values such that the low probability extremes of the
        ///   input distribution are clipped.
        ///   
        ///   This op determines the maximum scale_factor that would map the initial
        ///   [input_min, input_max] range to a range that lies within the representable
        ///   quantized range.
        ///   
        ///   It determines the scale from one of input_min and input_max, then updates the
        ///   other one to maximize the respresentable range.
        ///   
        ///   e.g.
        ///   
        ///   *   if the output is signed, num_bits = 8, [input_min, input_max] = [-10.0,
        ///   5.0]: it would use a scale_factor of -128 / -10.0 = 12.8 In this case, it
        ///   would update input_max to be 127 / 12.8 = 9.921875
        ///   *   if the output is signed, num_bits = 8, [input_min, input_max] = [-10.0,
        ///   10.0]: it would use a scale_factor of 127 / 10.0 = 12.7 In this case, it
        ///   would update input_min to be 128.0 / 12.7 = -10.07874
        ///   *   if the output is unsigned, input_min is forced to be 0, and only the
        ///   specified input_max is used.
        ///   
        ///   After determining the scale_factor and updating the input range, it applies the
        ///   following to each value in the 'input' tensor.
        ///   
        ///   output = round(clamp(value, input_min, input_max) * scale_factor) / scale_factor.
        ///   
        ///   The above round function rounds the value based on the given round_mode.
        ///   
        /// </remarks>
        public Output QuantizeAndDequantizeV2 (Output! input, Output! input_min, Output! input_max, bool? signed_input = null, long? num_bits = null, bool? range_given = null, string round_mode = null, bool? narrow_range = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("QuantizeAndDequantizeV2") OpName(MakeName("QuantizeAndDequantizeV2", operName));
            desc.AddInput(input);
            desc.AddInput(input_min);
            desc.AddInput(input_max);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (signed_input.HasValue) {
                desc.SetAttr("signed_input", signed_input);
            }

            if (num_bits.HasValue) {
                desc.SetAttr("num_bits", num_bits);
            }

            if (range_given.HasValue) {
                desc.SetAttr("range_given", range_given);
            }

            if (round_mode != null) {
                desc.SetAttr("round_mode", round_mode);
            }

            if (narrow_range.HasValue) {
                desc.SetAttr("narrow_range", narrow_range);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("QuantizeAndDequantizeV2") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

