        ///   Arbitrary number of tensors with arbitrary data types
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   The graph specifications(such as graph itself, input tensors and output names)
        ///   are stored as a serialized protocol buffer of RemoteFusedGraphExecuteInfo
        ///   as serialized_remote_fused_graph_execute_info.
        ///   The specifications will be passed to a dedicated registered
        ///   remote fused graph executor.  The executor will send the graph specifications
        ///   to a remote processor and execute that graph.  The execution results
        ///   will be passed to consumer nodes as outputs of this node.
        /// </remarks>
        public Output[] RemoteFusedGraphExecute (Output![] inputs, DataType[] Toutputs, string serialized_remote_fused_graph_execute_info, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("RemoteFusedGraphExecute") OpName(MakeName("RemoteFusedGraphExecute", operName));
            desc.AddInputs(inputs);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("Toutputs", Toutputs);
            desc.SetAttr("serialized_remote_fused_graph_execute_info", serialized_remote_fused_graph_execute_info);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("RemoteFusedGraphExecute") Message(status.Message);
                }
                int _idx = 0;
                int _n = 0;
                _n = op.GetOutputListLength("outputs");
                var outputs = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    outputs [i] = new Output withOp(op) Index(_idx++);
                }

                return outputs;
            }
        }

