        /// <summary>
        ///   Update '*var' according to the centered RMSProp algorithm.
        /// </summary>
        /// <param name="var">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="mg">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="ms">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="mom">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="lr">
        ///   Scaling factor. Must be a scalar.
        /// </param>
        /// <param name="rho">
        ///   Decay rate. Must be a scalar.
        /// </param>
        /// <param name="momentum">
        /// </param>
        /// <param name="epsilon">
        ///   Ridge term. Must be a scalar.
        /// </param>
        /// <param name="grad">
        ///   The gradient.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'ResourceApplyCenteredRMSProp'.
        /// </param>
        /// <param name="use_locking">
        ///   Optional argument
        ///   If <c>True</c>, updating of the var, mg, ms, and mom tensors is
        ///   protected by a lock; otherwise the behavior is undefined, but may exhibit less
        ///   contention.
        /// </param>
        /// <returns>
        ///   Returns the description of the operation
        /// </returns>
        /// <remarks>
        ///   The centered RMSProp algorithm uses an estimate of the centered second moment
        ///   (i.e., the variance) for normalization, as opposed to regular RMSProp, which
        ///   uses the (uncentered) second moment. This often helps with training, but is
        ///   slightly more expensive in terms of computation and memory.
        ///   
        ///   Note that in dense implementation of this algorithm, mg, ms, and mom will
        ///   update even if the grad is zero, but in this sparse implementation, mg, ms,
        ///   and mom will not update in iterations during which the grad is zero.
        ///   
        ///   mean_square = decay * mean_square + (1-decay) * gradient ** 2
        ///   mean_grad = decay * mean_grad + (1-decay) * gradient
        ///   
        ///   Delta = learning_rate * gradient / sqrt(mean_square + epsilon - mean_grad ** 2)
        ///   
        ///   mg &amp;lt;- rho * mg_{t-1} + (1-rho) * grad
        ///   ms &amp;lt;- rho * ms_{t-1} + (1-rho) * grad * grad
        ///   mom &amp;lt;- momentum * mom_{t-1} + lr * grad / sqrt(ms - mg * mg + epsilon)
        ///   var &amp;lt;- var - mom
        /// </remarks>
        public Operation ResourceApplyCenteredRMSProp (Output! var, Output! mg, Output! ms, Output! mom, Output! lr, Output! rho, Output! momentum, Output! epsilon, Output! grad, bool? use_locking = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("ResourceApplyCenteredRMSProp") OpName(MakeName("ResourceApplyCenteredRMSProp", operName));
            desc.AddInput(var);
            desc.AddInput(mg);
            desc.AddInput(ms);
            desc.AddInput(mom);
            desc.AddInput(lr);
            desc.AddInput(rho);
            desc.AddInput(momentum);
            desc.AddInput(epsilon);
            desc.AddInput(grad);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (use_locking.HasValue) {
                desc.SetAttr("use_locking", use_locking);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("ResourceApplyCenteredRMSProp") Message(status.Message);
                }
                return op;
            }
        }

