        ///   Empty strings indicate that they are non-partitioned tensors.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'RestoreV2'.
        /// </param>
        /// <param name="dtypes">
        ///   shape {N}.  The list of expected dtype for the tensors.  Must match
        ///   those stored in the checkpoint.
        /// </param>
        /// <returns>
        ///   shape {N}.  The restored tensors, whose shapes are read from the
        ///   checkpoint directly.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   For backward compatibility with the V1 format, this Op currently allows
        ///   restoring from a V1 checkpoint as well:
        ///   - This Op first attempts to find the V2 index file pointed to by "prefix", and
        ///   if found proceed to read it as a V2 checkpoint;
        ///   - Otherwise the V1 read path is invoked.
        ///   Relying on this behavior is not recommended, as the ability to fall back to read
        ///   V1 might be deprecated and eventually removed.
        ///   
        ///   By default, restores the named tensors in full.  If the caller wishes to restore
        ///   specific slices of stored tensors, "shape_and_slices" should be non-empty
        ///   strings and correspondingly well-formed.
        ///   
        ///   Callers must ensure all the named tensors are indeed stored in the checkpoint.
        /// </remarks>
        public Output[] RestoreV2 (Output! prefix, Output! tensor_names, Output! shape_and_slices, DataType[] dtypes, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("RestoreV2") OpName(MakeName("RestoreV2", operName));
            desc.AddInput(prefix);
            desc.AddInput(tensor_names);
            desc.AddInput(shape_and_slices);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("dtypes", dtypes);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("RestoreV2") Message(status.Message);
                }
                int _idx = 0;
                int _n = 0;
                _n = op.GetOutputListLength("tensors");
                var tensors = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    tensors [i] = new Output withOp(op) Index(_idx++);
                }

                return tensors;
            }
        }

