        /// <summary>
        ///   Sparse update entries in '*var' and '*accum' according to FOBOS algorithm.
        /// </summary>
        /// <param name="var">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="accum">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="lr">
        ///   Learning rate. Must be a scalar.
        /// </param>
        /// <param name="l1">
        ///   L1 regularization. Must be a scalar.
        /// </param>
        /// <param name="l2">
        ///   L2 regularization. Must be a scalar.
        /// </param>
        /// <param name="grad">
        ///   The gradient.
        /// </param>
        /// <param name="indices">
        ///   A vector of indices into the first dimension of var and accum.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'SparseApplyProximalAdagrad'.
        /// </param>
        /// <param name="use_locking">
        ///   Optional argument
        ///   If True, updating of the var and accum tensors will be protected by
        ///   a lock; otherwise the behavior is undefined, but may exhibit less contention.
        /// </param>
        /// <returns>
        ///   Same as "var".
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   That is for rows we have grad for, we update var and accum as follows:
        ///   $$accum += grad * grad$$
        ///   $$prox_v = var$$
        ///   $$prox_v -= lr * grad * (1 / sqrt(accum))$$
        ///   $$var = sign(prox_v)/(1+lr*l2) * max{|prox_v|-lr*l1,0}$$
        /// </remarks>
