        /// <summary>
        ///   Update '*var' according to the RMSProp algorithm.
        /// </summary>
        /// <param name="var">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="ms">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="mom">
        ///   Should be from a Variable().
        /// </param>
        /// <param name="lr">
        ///   Scaling factor. Must be a scalar.
        /// </param>
        /// <param name="rho">
        ///   Decay rate. Must be a scalar.
        /// </param>
        /// <param name="momentum">
        /// </param>
        /// <param name="epsilon">
        ///   Ridge term. Must be a scalar.
        /// </param>
        /// <param name="grad">
        ///   The gradient.
        /// </param>
        /// <param name="indices">
        ///   A vector of indices into the first dimension of var, ms and mom.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'SparseApplyRMSProp'.
        /// </param>
        /// <param name="use_locking">
        ///   Optional argument
        ///   If <c>True</c>, updating of the var, ms, and mom tensors is protected
        ///   by a lock; otherwise the behavior is undefined, but may exhibit less
        ///   contention.
        /// </param>
        /// <returns>
        ///   Same as "var".
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   Note that in dense implementation of this algorithm, ms and mom will
        ///   update even if the grad is zero, but in this sparse implementation, ms
        ///   and mom will not update in iterations during which the grad is zero.
        ///   
        ///   mean_square = decay * mean_square + (1-decay) * gradient ** 2
        ///   Delta = learning_rate * gradient / sqrt(mean_square + epsilon)
        ///   
        ///   $$ms &amp;lt;- rho * ms_{t-1} + (1-rho) * grad * grad$$
        ///   $$mom &amp;lt;- momentum * mom_{t-1} + lr * grad / sqrt(ms + epsilon)$$
        ///   $$var &amp;lt;- var - mom$$
        /// </remarks>
        public Output SparseApplyRMSProp (Output! var, Output! ms, Output! mom, Output! lr, Output! rho, Output! momentum, Output! epsilon, Output! grad, Output! indices, bool? use_locking = null, string operName = null)
