            desc.AddInput(var);
            desc.AddInput(ms);
            desc.AddInput(mom);
            desc.AddInput(lr);
            desc.AddInput(rho);
            desc.AddInput(momentum);
            desc.AddInput(epsilon);
            desc.AddInput(grad);
            desc.AddInput(indices);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            if (use_locking.HasValue) {
                desc.SetAttr("use_locking", use_locking);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("SparseApplyRMSProp") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

        /// <summary>
        ///   Concatenates a list of <c>SparseTensor</c> along the specified dimension.
        /// </summary>
        /// <param name="indices">
        ///   2-D.  Indices of each input <c>SparseTensor</c>.
        /// </param>
        /// <param name="values">
        ///   1-D.  Non-empty values of each <c>SparseTensor</c>.
        /// </param>
        /// <param name="shapes">
        ///   1-D.  Shapes of each <c>SparseTensor</c>.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'SparseConcat'.
        /// </param>
        /// <param name="concat_dim">
        ///   Dimension to concatenate along. Must be in range [-rank, rank),
        ///   where rank is the number of dimensions in each input <c>SparseTensor</c>.
        /// </param>
        /// <returns>
        ///   Returns a tuple with multiple values, as follows:
        ///   output_indices: 2-D.  Indices of the concatenated <c>SparseTensor</c>.
        ///   output_values: 1-D.  Non-empty values of the concatenated <c>SparseTensor</c>.
        ///   output_shape: 1-D.  Shape of the concatenated <c>SparseTensor</c>.
        ///   The Operation can be fetched from any of the Outputs returned in the tuple values, by fetching the Operation property.
        /// </returns>
        /// <remarks>
        ///   Concatenation is with respect to the dense versions of these sparse tensors.
        ///   It is assumed that each input is a <c>SparseTensor</c> whose elements are ordered
        ///   along increasing dimension number.
        ///   
        ///   All inputs' shapes must match, except for the concat dimension.  The
        ///   <c>indices</c>, <c>values</c>, and <c>shapes</c> lists must have the same length.
        ///   
        ///   The output shape is identical to the inputs', except along the concat
        ///   dimension, where it is the sum of the inputs' sizes along that dimension.
        ///   
        ///   The output elements will be resorted to preserve the sort order along
        ///   increasing dimension number.
        ///   
        ///   This op runs in <c>O(M log M)</c> time, where <c>M</c> is the total number of non-empty
        ///   values across all inputs. This is due to the need for an internal sort in
        ///   order to concatenate efficiently across an arbitrary dimension.
        ///   
        ///   For example, if <c>concat_dim = 1</c> and the inputs are
        ///   
        ///   sp_inputs[0]: shape = [2, 3]
        ///   [0, 2]: "a"
        ///   [1, 0]: "b"
        ///   [1, 1]: "c"
        ///   
        ///   sp_inputs[1]: shape = [2, 4]
        ///   [0, 1]: "d"
        ///   [0, 2]: "e"
        ///   
        ///   then the output will be
        ///   
        ///   shape = [2, 7]
        ///   [0, 2]: "a"
        ///   [0, 4]: "d"
        ///   [0, 5]: "e"
        ///   [1, 0]: "b"
        ///   [1, 1]: "c"
        ///   
        ///   Graphically this is equivalent to doing
        ///   
        ///   [    a] concat [  d e  ] = [    a   d e  ]
        ///   [b c  ]        [       ]   [b c          ]
        /// </remarks>
        public (Output output_indices, Output output_values, Output output_shape) SparseConcat (Output![] indices, Output![] values, Output![] shapes, long concat_dim, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("SparseConcat") OpName(MakeName("SparseConcat", operName));
            desc.AddInputs(indices);
            desc.AddInputs(values);
            desc.AddInputs(shapes);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("concat_dim", concat_dim);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("SparseConcat") Message(status.Message);
                }
                int _idx = 0;
                var output_indices = new Output withOp(op) Index(_idx++);
                var output_values = new Output withOp(op) Index(_idx++);
                var output_shape = new Output withOp(op) Index(_idx++);
                return (output_indices, output_values, output_shape);
            }
        }

