        /// <summary>
        ///   Generates sparse cross from a list of sparse and dense tensors.
        /// </summary>
        /// <param name="indices">
        ///   2-D.  Indices of each input <c>SparseTensor</c>.
        /// </param>
        /// <param name="values">
        ///   1-D.   values of each <c>SparseTensor</c>.
