        ///   
        ///   inputs[0]: SparseTensor with shape = [2, 2]
        ///   [0, 0]: "a"
        ///   [1, 0]: "b"
        ///   [1, 1]: "c"
        ///   
        ///   inputs[1]: SparseTensor with shape = [2, 1]
        ///   [0, 0]: "d"
        ///   [1, 0]: "e"
