        /// <summary>
        ///   Component-wise divides a SparseTensor by a dense Tensor.
        /// </summary>
        /// <param name="sp_indices">
        ///   2-D.  <c>N x R</c> matrix with the indices of non-empty values in a
        ///   SparseTensor, possibly not in canonical ordering.
        /// </param>
        /// <param name="sp_values">
        ///   1-D.  <c>N</c> non-empty values corresponding to <c>sp_indices</c>.
        /// </param>
        /// <param name="sp_shape">
        ///   1-D.  Shape of the input SparseTensor.
        /// </param>
        /// <param name="dense">
        ///   <c>R</c>-D.  The dense Tensor operand.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'SparseDenseCwiseDiv'.
        /// </param>
        /// <returns>
        ///   1-D.  The <c>N</c> values that are operated on.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        /// <remarks>
        ///   *Limitation*: this Op only broadcasts the dense side to the sparse side, but not
        ///   the other direction.
        /// </remarks>
        public Output SparseDenseCwiseDiv (Output! sp_indices, Output! sp_values, Output! sp_shape, Output! dense, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("SparseDenseCwiseDiv") OpName(MakeName("SparseDenseCwiseDiv", operName));
            desc.AddInput(sp_indices);
            desc.AddInput(sp_values);
            desc.AddInput(sp_shape);
            desc.AddInput(dense);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
