        /// </param>
        /// <param name="indices">
        ///   2-D tensor represents the indices of the sparse tensor.
        /// </param>
        /// <param name="values">
        ///   1-D tensor represents the values of the sparse tensor.
        /// </param>
        /// <param name="shape">
        ///   1-D. tensor represents the shape of the sparse tensor.
        ///   output indices: A list of 1-D tensors represents the indices of the output
        ///   sparse tensors.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'SparseSplit'.
        /// </param>
        /// <param name="num_split">
        ///   The number of ways to split.
        /// </param>
        /// <returns>
        ///   Returns a tuple with multiple values, as follows:
        ///   output_indices:
        ///   output_values: A list of 1-D tensors represents the values of the output sparse
        ///   tensors.
        ///   output_shape: A list of 1-D tensors represents the shape of the output sparse
        ///   tensors.
        ///   The Operation can be fetched from any of the Outputs returned in the tuple values, by fetching the Operation property.
        /// </returns>
        /// <remarks>
        ///   If the <c>shape[split_dim]</c> is not an integer multiple of <c>num_split</c>. Slices
        ///   <c>[0 : shape[split_dim] % num_split]</c> gets one extra dimension.
        ///   For example, if <c>split_dim = 1</c> and <c>num_split = 2</c> and the input is
        ///   
        ///   input_tensor = shape = [2, 7]
        ///   [    a   d e  ]
        ///   [b c          ]
        ///   
        ///   Graphically the output tensors are:
        ///   
        ///   output_tensor[0] = shape = [2, 4]
        ///   [    a  ]
        ///   [b c    ]
        ///   
        ///   output_tensor[1] = shape = [2, 3]
        ///   [ d e  ]
        ///   [      ]
        /// </remarks>
        public (Output[] output_indices, Output[] output_values, Output[] output_shape) SparseSplit (Output! split_dim, Output! indices, Output! values, Output! shape, long num_split, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("SparseSplit") OpName(MakeName("SparseSplit", operName));
            desc.AddInput(split_dim);
            desc.AddInput(indices);
            desc.AddInput(values);
            desc.AddInput(shape);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("num_split", num_split);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("SparseSplit") Message(status.Message);
                }
                int _idx = 0;
                int _n = 0;
                _n = op.GetOutputListLength("output_indices");
                var output_indices = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    output_indices [i] = new Output withOp(op) Index(_idx++);
                }

                _n = op.GetOutputListLength("output_values");
                var output_values = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    output_values [i] = new Output withOp(op) Index(_idx++);
                }

                _n = op.GetOutputListLength("output_shape");
                var output_shape = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    output_shape [i] = new Output withOp(op) Index(_idx++);
                }

                return (output_indices, output_values, output_shape);
            }
        }

