        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'Split'.
        /// </param>
        /// <param name="num_split">
        ///   The number of ways to split.  Must evenly divide
        ///   <c>value.shape[split_dim]</c>.
        /// </param>
        /// <returns>
        ///   They are identically shaped tensors, whose shape matches that of <c>value</c>
        ///   except along <c>axis</c>, where their sizes are
        ///   <c>values.shape[split_dim] / num_split</c>.
        ///   The Operation can be fetched from the resulting Output, by fetching the Operation property from the result.
        /// </returns>
        public Output[] Split (Output! split_dim, Output! value, long num_split, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("Split") OpName(MakeName("Split", operName));
            desc.AddInput(split_dim);
            desc.AddInput(value);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("num_split", num_split);
            
            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("Split") Message(status.Message);
                }
                int _idx = 0;
                int _n = 0;
                _n = op.GetOutputListLength("output");
                var output = new Output[_n];
                for (int i = 0; i < _n; i++) {
                    output [i] = new Output withOp(op) Index(_idx++);
                }

                return output;
            }
        }

