        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'ThreadUnsafeUnigramCandidateSampler'.
        /// </param>
        /// <param name="seed">
        ///   Optional argument
        ///   If either seed or seed2 are set to be non-zero, the random number
        ///   generator is seeded by the given seed.  Otherwise, it is seeded by a
        ///   random seed.
        /// </param>
        /// <param name="seed2">
        ///   Optional argument
        ///   An second seed to avoid seed collision.
        /// </param>
        /// <param name="num_true">
        ///   Number of true labels per context.
        /// </param>
        /// <param name="num_sampled">
        ///   Number of candidates to randomly sample.
        /// </param>
        /// <param name="unique">
        ///   If unique is true, we sample with rejection, so that all sampled
        ///   candidates in a batch are unique. This requires some approximation to
        ///   estimate the post-rejection sampling probabilities.
        /// </param>
        /// <param name="range_max">
        ///   The sampler will sample integers from the interval [0, range_max).
        /// </param>
        /// <returns>
        ///   Returns a tuple with multiple values, as follows:
        ///   sampled_candidates: A vector of length num_sampled, in which each element is
        ///   the ID of a sampled candidate.
        ///   true_expected_count: A batch_size * num_true matrix, representing
        ///   the number of times each candidate is expected to occur in a batch
        ///   of sampled candidates. If unique=true, then this is a probability.
        ///   sampled_expected_count: A vector of length num_sampled, for each sampled
        ///   candidate representing the number of times the candidate is expected
        ///   to occur in a batch of sampled candidates.  If unique=true, then this is a
        ///   probability.
        ///   The Operation can be fetched from any of the Outputs returned in the tuple values, by fetching the Operation property.
        /// </returns>
        /// <remarks>
        ///   See explanations of candidate sampling and the data formats at
        ///   go/candidate-sampling.
        ///   
        ///   For each batch, this op picks a single set of sampled candidate labels.
        ///   
        ///   The advantages of sampling candidates per-batch are simplicity and the
        ///   possibility of efficient dense matrix multiplication. The disadvantage is that
        ///   the sampled candidates must be chosen independently of the context and of the
        ///   true labels.
        /// </remarks>
        public (Output sampled_candidates, Output true_expected_count, Output sampled_expected_count) ThreadUnsafeUnigramCandidateSampler (Output! true_classes, long num_true, long num_sampled, bool unique, long range_max, long? seed = null, long? seed2 = null, string operName = null)
        {
            var desc = new OperationDescription withGraph(this) OpType("ThreadUnsafeUnigramCandidateSampler") OpName(MakeName("ThreadUnsafeUnigramCandidateSampler", operName));
            desc.AddInput(true_classes);
             
            foreach (Operation control in CurrentDependencies) {
                desc.AddControlInput(control);
            }

            desc.SetAttr("num_true", num_true);
            desc.SetAttr("num_sampled", num_sampled);
            desc.SetAttr("unique", unique);
            desc.SetAttr("range_max", range_max);
            
            if (seed.HasValue) {
                desc.SetAttr("seed", seed);
            }

            if (seed2.HasValue) {
                desc.SetAttr("seed2", seed2);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("ThreadUnsafeUnigramCandidateSampler") Message(status.Message);
                }
                int _idx = 0;
                var sampled_candidates = new Output withOp(op) Index(_idx++);
                var true_expected_count = new Output withOp(op) Index(_idx++);
                var sampled_expected_count = new Output withOp(op) Index(_idx++);
                return (sampled_candidates, true_expected_count, sampled_expected_count);
            }
        }

