            }

            if (replace_control_characters.HasValue) {
                desc.SetAttr("replace_control_characters", replace_control_characters);
            }

            using (var status = new Status()) {
                var (success, op) = desc.FinishOperation(status);
                if(!success) {
                    throw new OpCreateException withOpType("UnicodeTranscode") Message(status.Message);
                }
                int _idx = 0;
                var output = new Output withOp(op) Index(_idx++);
                return output;
            }
        }

        /// <summary>
        ///   Generates labels for candidate sampling with a uniform distribution.
        /// </summary>
        /// <param name="true_classes">
        ///   A batch_size * num_true matrix, in which each row contains the
        ///   IDs of the num_true target_classes in the corresponding original label.
        /// </param>
        /// <param name="operName">
        ///   If specified, the created operation in the graph will be this one, otherwise it will be named 'UniformCandidateSampler'.
        /// </param>
